'use client';
import { cn } from '@/lib/utils';
import { ClassValue } from 'clsx';
import { useTheme } from 'next-themes';
import { useIsClient } from 'usehooks-ts';

export default function FutureIcon({
  className,
}: {
  className?: React.CSSProperties | ClassValue | string;
}) {
  const isClient = useIsClient();
  const { resolvedTheme } = useTheme();

  if (!isClient) {
    return null;
  }

  return resolvedTheme === 'dark' ? (
    <svg
      className={cn('', className)}
      width="70"
      height="30"
      viewBox="0 0 70 30"
      fill="currentColor"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
    >
      <rect
        x="0.568359"
        width="68.4902"
        height="29.4964"
        fill="url(#pattern0_613_673)"
      />
      <defs>
        <pattern
          id="pattern0_613_673"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use
            xlinkHref="#image0_613_673"
            transform="scale(0.00133333 0.00309598)"
          />
        </pattern>
        <image
          id="image0_613_673"
          width="750"
          height="323"
          preserveAspectRatio="none"
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  ) : (
    <svg
      className={cn(className)}
      width="70"
      height="30"
      viewBox="0 0 70 30"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
    >
      <rect
        x="0.568359"
        width="68.4902"
        height="29.4964"
        fill="url(#pattern0_817_239)"
      />
      <defs>
        <pattern
          id="pattern0_817_239"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use
            xlinkHref="#image0_817_239"
            transform="scale(0.00133333 0.00309598)"
          />
        </pattern>
        <image
          id="image0_817_239"
          width="750"
          height="323"
          preserveAspectRatio="none"
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
}
